  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report cover activities
  during September - December 1949 for Lake Ardoch, Billings Lake, Buffalo Lake, Brumba
  Lake, Johnson Lake, Kelly's Slough, Lac Aux Morte (Devil's Lake), Lambs Lake, Little
  Goose, Minnewastena, Pleasant Lake, Prairie Lake, Rose Lake, Rock Lake,  Snyder
  Lake, Sibley Lake, Silver Lake, Woodlake Marsh, Stump Lake. Water and wildlife are
  discussed. Followed by refuge development and maintenance, public relations, violations
  and field investigations or applied research. Photographs and NR forms are included.\",\n\t\"owner_org\":
